const CvTechstack = () => {
  return (
    <div className="px-12 py-6 my-6 mx-12 rounded-2xl bg-gradient-to-r from-emerald-200 to-90% to-transparent">
      <ul className=" list-none flex flex-col gap-2">
        <li className=" bg-amber-300 rounded-md hover:bg-amber-500 w-50 p-2 cursor-pointer">HTML (HTML5)</li>
        <li className=" bg-amber-300 rounded-md hover:bg-amber-500 w-50 p-2 cursor-pointer">CSS (CSS3)</li>
        <li className=" bg-amber-300 rounded-md hover:bg-amber-500 w-50 p-2 cursor-pointer">SCSS</li>
        <li className=" bg-amber-300 rounded-md hover:bg-amber-500 w-50 p-2 cursor-pointer">JavaScript (ES6)</li>
        <li className=" bg-amber-300 rounded-md hover:bg-amber-500 w-50 p-2 cursor-pointer">React</li>
        <li className=" bg-amber-300 rounded-md hover:bg-amber-500 w-50 p-2 cursor-pointer">Typescript</li>
        <li className=" bg-amber-300 rounded-md hover:bg-amber-500 w-50 p-2 cursor-pointer">TailwindCSS</li>
      </ul>
    </div>
  );
};

export default CvTechstack;
